$(function(){$("#datePicker").datetimepicker(Core.dateTimePickerDateOptions);$("#timePicker").datetimepicker(Core.dateTimePickerTimeOptions);$('[data-toggle="tooltip"]').tooltip()});const App=new Vue({el:"#app",data:function(){return{statInfo:{},metData:{},now:new Date}},created:function(){const n=this;Core.getURLParameters(this);n.getData([]);setInterval(function(){n.getData()},3e5);Core.populateStationDropdown(this,!1)},computed:{currentDate:function(){return moment().format("MM/DD/YYYY")},currentTime:function(){return moment().format("HH:mm:ss")}},methods:{getData:function(n){const t=this;axios.get("/data/StationInfo",{params:{stationid:n.id,dateTime:n.dateTime}}).then(function(n){t.statInfo=n.data}).catch(function(n){console.log("getMeteorologicalData failed",n)});axios.get("/data/StationData",{params:{stationid:n.id,dateTime:n.dateTime}}).then(function(n){t.metData=n.data;Vue.nextTick(function(){t.now=new Date;$('[data-toggle="tooltip"]').tooltip({boundary:"span",placement:"left"})})}).catch(function(n){console.log("getMeteorologicalData failed",n)})}}});